import React, { useState,useEffect } from "react";
import { ListOfGoals } from "../ApiManager"

export const GoalList = () => {
  const [goalList, setGoalList] = useState([]);

      useEffect(
         () => {
            ListOfGoals()
            .then((data) => {
               setGoalList(data)
               console.log(data)
            })
         }, []
      )



  return (
     <>
     <h1>Goal List</h1>

      {
         goalList.map((goal) => {
            return (
               <div key={goal.id}>
               <p>{goal.name}{goal.goalDescription} {goal.goalObjective} {goal.goalNotes}</p>
            </div>
            )
         })
      }


    </>
  );
};
